function extractImageSrcs(htmlString) {
  if (typeof htmlString !== 'string') {
    console.error("Input must be a string.");
    return null;
  }

  const srcs = [];
  const parser = new DOMParser();
  const doc = parser.parseFromString(htmlString, 'text/html');

  // Extract srcset URLs from <source> tags
  const sourceTags = doc.querySelectorAll('picture source');
  sourceTags.forEach((source) => {
    const srcset = source.getAttribute('srcset');
    if (srcset) {
      const urls = srcset.split(',').map((entry) => entry.trim().split(' ')[0]); // Extract URLs
      srcs.push(...urls);
    }
  });

  // Extract src from <img> tags inside <picture>
  const imgTag = doc.querySelector('picture img');
  if (imgTag) {
    const imgSrc = imgTag.getAttribute('src');
    if (imgSrc) {
      srcs.push(imgSrc);
    }
  }

  return srcs;
}



async function downloadImageFromHtml(htmlString) {
    const src = extractImageSrc(htmlString);
    if (!src) {
        console.error("No image source found in the HTML.");
        return;
    }
    try {
        const response = await fetch(src);
        if (!response.ok) {
            throw new Error(`HTTP error! status: ${response.status}`);
        }

        const blob = await response.blob();
        const link = document.createElement('a');
        link.href = URL.createObjectURL(blob);
        let filename = src.substring(src.lastIndexOf('/') + 1);
        if (!filename) {
            filename = "downloaded_image.jpg";
        }
        link.download = filename;
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
        URL.revokeObjectURL(link.href);

        console.log(`Downloaded: ${filename}`);
    } catch (error) {
        console.error("Error downloading image:", error);
    }
}

